    "2013-03-15T20:37:47.246262",nt"name": "hw1-q02-tif-hawaii-i-southeastern-hawaiian-ridge-u-s-eez-gloria-sidescan-sonar-data-mosaic-2-",nt"isopen":
    false,nt"url": null,nt"notes": "Survey of the southeastern Hawaiian Ridge
    was the fifth major segment of the Exclusive Economic Zone (EEZ) mapping program
    to have been initiated. Data acquisition for this region required approximately
    one-half year and were acquired during eight cruises over a four year period from
    1986 through 1989, skipping 1987. At the conclusion of the survey 29 mosaics of
    a 2 degree by 2 degree were completed for the region. As in earlier EEZ reconnaissance
    surveys, the USGS utilized the GLORIA (Geological LOng-Range Inclined Asdic) sidescan-sonar
    system to complete the geologic mapping. The collected GLORIA data were processed
    and digitally mosaicked to produce continuous imagery of the seafloor. A total of
    twenty-seven digital mosaics of a 2 degree by 2 degree area and 2 mosaics of 2.25
    degree by 2 degree with a 50-meter pixel resolution were completed for the region.",nt"license_title":
